El poema es un soneto satírico de Luis de Góngora que se burla de la toma de Larache (ciudad en la costa atlántica de Marruecos) por las tropas españolas en 1610. Góngora vivió entre 1561 y 1627, por lo que pertenece al siglo XVII.
